import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Add an item to the cart
    await page.waitForSelector('.add-to-cart', { timeout: 5000 });
    await page.locator('.add-to-cart').first().click();

    // Wait for the notification to appear and disappear to avoid interference
    await page.waitForSelector('.notification.show', { timeout: 5000 });
    await page.waitForSelector('.notification:not(.show)', { timeout: 5000 });

    // 2. Open the cart modal
    await page.locator('div.cart').click();
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_opened.png'));

    // 3. Extract initial quantity
    await page.waitForSelector('.cart-item .quantity', { timeout: 5000 });
    const initialQuantity = await page.locator('.cart-item .quantity').textContent();

    // 4. Click the '+' button to increase the quantity
    // The '+' button is the last .quantity-btn in the cart item
    await page.locator('.cart-item .quantity-btn').last().click();

    // Wait for the quantity to update. We can check if the text content changes.
    await page.waitForFunction(
      (initialQty) => {
        const currentQty = document.querySelector('.cart-item .quantity').textContent;
        return currentQty !== initialQty;
      },
      initialQuantity,
      { timeout: 5000 }
    );

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_quantity_updated.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_quantity_updated.png'));

    // 5. Extract updated quantity
    const updatedQuantity = await page.locator('.cart-item .quantity').textContent();

    return {
      success: true,
      action: "Updated cart item quantity",
      extractedData: {
        initialQuantity: parseInt(initialQuantity, 10),
        updatedQuantity: parseInt(updatedQuantity, 10)
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to update cart item quantity",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
